class Genre extends Component {
    render() { 
        return <div>
            <br /> <br />

            <ul className="list-group">
            <li className="list-group-item-action active">Action</li>
            <li className="list-group-item">Comedy</li>
            <li className="list-group-item">thrilled</li>
            </ul>

        </div>;
    }
}

export default Genre;
